import React from "react";
import "./Card.css"; // Стилі для картки

const RocketCard = ({ rocket }) => {
  return (
    <div className="rocket-card">
      <div className="rocket-card__image">
        <img
          src={rocket.imageUrl}
          alt={rocket.name}
          onError={(e) => (e.target.src = "https://via.placeholder.com/300")} // Якщо зображення не завантажується
        />
      </div>
      <div className="rocket-card__info">
        <h2>{rocket.name}</h2>
        <p>Country: {rocket.country}</p>
        <p>Manufacturer: {rocket.manufacturer}</p>
        <p>Launches: {rocket.launchCount || "N/A"}</p>{" "}
        {/* Додаємо перевірку на кількість запусків */}
      </div>
    </div>
  );
};

export default RocketCard;
